import React, { Component } from 'react'
import { Button, Container, Divall, FlexContainer, InputSearch } from './Todo'

export default class extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [],
      modal: false,
      Firstname: "",
      Lastname: "",
      Address:  "",
    }
  }
  render() {
    return (
      <Container>
        <FlexContainer>
          <InputSearch type={'text'} placeholder={'Search'} widthh />
          {this.state.modal===true ? <Button>Add User</Button>: <Button onClick={() => this.setState({ modal: !this.state.modal })}> + New User 
           </Button>}
        </FlexContainer>
        <Divall open={this.state.modal}>
          {this.state.modal === true && <FlexContainer >
            <InputSearch placeholder='Firstname' name='Firstname' value={this.state.Firstname}
            onChange={(e)=> this.onChangeAll}
            />
            <InputSearch placeholder='Lastname' name='Lastname' value={this.state.Lastname} widthh />
          </FlexContainer>}
        </Divall>
      </Container>
    )
  }
}
